Jibi est un compte de paiement accessible 24h/24 et 7j/7 depuis l’application mobile, permettant à son détenteur d’effectuer une multitude d’opérations de manière simple, rapide et sécurisée depuis son téléphone mobile.
L’ouverture d’un compte Jibi Basic, plafonné à 200 DHS est immédiate au niveau de l’application Jibi.
L’ouverture d’un compte Classique plafonné à 5.000 DHS, ou d’un compte Prémium plafonné à  20.000 DHS est disponible au niveau de tout le réseau d’agences Wafacash ainsi que ses Agents Agréés.
Le compte de paiement Jibi offre une multitude de services à savoir :
-	Le dépôt sur le compte et le retrait du compte au niveau de tout le réseau d’agences Wafacash ainsi que ses Agents Agréés ;
-	Alimentation du compte ;
-	Paiement d’un commerçant gratuitement par technologie QR Code ou par saisie du numéro de téléphone du commerçant ;
-	Paiement de factures ;
-	Recharges téléphoniques ;
-	Envoi d’argent vers un autre compte de paiement mobile Jibi ;
-	Envoi d’argent vers une agence ;
-	Réception d’argent d’une agence ou d’un autre mobile ;
-	Paiement en ligne ;
-	Consultation en temps réel du solde et de l’historique de ses opérations ;
-	Simulation des frais de transfert ;
-	Géolocalisation des agences offrant le service ;
-	Aide et Foire aux questions
L'application Jibi vous permet un contrôle total et un suivi complet de vos opérations en temps réel.
Ne perdez pas de temps et facilitez-vous la vie en ouvrant un compte de paiement Basic sur votre application mobile jibi dès maintenant !
Ce service est également offert pour les clients d’Attijariwafa bank, consultez votre conseiller en agence pour plus d’informations.
